import React from 'react';
// import { Row, Col } from 'react-flexbox-grid';

const skillsetList = [
    {
        title: 'Languages',
        value: [
            'Golang',
            'Python',
            'Node.js',
            'Javascript (Front-End) / ES6-7',
            'HTML5',
            'CSS3',
            'Sass',
            'SQL',
            'Markdown',
        ],
    },
    {
        title: 'Languages',
        value: [
            'Golang',
            'Python',
            'Node.js',
            'Javascript (Front-End) / ES6-7',
            'HTML5',
            'CSS3',
            'Sass',
            'SQL',
            'Markdown',
        ],
    },
]
const Skillset = () => (
    <Row>
        {skillsetList.map(item => (
            <Col xs={6}>
                <p>{item.title}</p>
                {item.map(subitem => (
                    <li>{subitem}</li>
                ))}
            </Col>
        ))}
    </Row>
);

export default Skillset;
